void test_intersection_simdgalloping_V1_degrade(){
  textsim::simdgalloping interstc;
  std::vector<std::pair<uint32_t, uint64_t>> posting1 = {{1,1},{2,3},{4,5}};
  std::vector<std::pair<uint32_t, uint64_t>> posting2 = {{2,3},{4,5},{7,8},{9,10},{13,12},{14,12},{16,7}};
  std::vector<std::pair<uint32_t, uint64_t>> posting3;
  std::vector<std::pair<uint32_t, uint64_t>> posting4;

  interstc.V1(posting1,posting2,posting3,posting4);
  std::cout<<"overlapped1\t";
  for(auto i : posting3){
    std::cout<<i.first<<"--"<<i.second<<"\t";
  };

  std::cout<<std::endl;
  std::cout<<"overlapped2\t";
  for(auto i : posting4){
    std::cout<<i.first<<"--"<<i.second<<"\t";
  }
  std::cout<<std::endl;
  std::cout<<"------------------------"<<std::endl;
}

